# === –î—Ä—É–≥–∏–µ —Ç—Ä–∏–≥–≥–µ—Ä—ã ===
THANKS_WORDS = {'—Å–ø–∞—Å–∏–±–æ'}
OK_WORDS = {'–æ–∫', '–æ–∫–µ–π', '–æ–∫–∏'}
EAT_WORDS = {'–∫—É—à–∞—Ç—å', '–∫—É—à–∞–ª–∏', '–µ–ª–∏'}
FUNNY_EMOJIS = {'üòÇ', 'ü§£', 'üòÜ', 'üòπ', 'üòÄ', 'üòÉ', 'üòÑ', 'üòÅ', 'üòÖ', 'üôÉ', 'üòú', 'ü§™', 'üòù', 'ü§ë'}

# === –í—Å–ø–æ–º–æ–≥–∞—Ç–µ–ª—å–Ω—ã–µ —Ñ—É–Ω–∫—Ü–∏–∏ ===

def clean_word(word):
    return re.sub(r'[^–∞-—è—ë]', '', word.lower())

def text_to_words(text):
    return {clean_word(w) for w in text.split()}

def contains_any(text, word_set):
    if not text:
        return False
    return bool(text_to_words(text) & word_set)

def contains_funny_emoji(text):
    if not text:
        return False
    return bool(set(text) & FUNNY_EMOJIS)

def find_first_bad_word(text):
    if not text:
        return None
    for word in text.split():
        clean = clean_word(word)
        if clean in BAD_WORDS:
            return clean
    return None

