# === –û—Å–Ω–æ–≤–Ω–æ–π –æ–±—Ä–∞–±–æ—Ç—á–∏–∫ —Ç–µ–∫—Å—Ç–∞ ===

async def handle_text(update, context):
    text = update.message.text
    if not text:
        return

    # 1. –ú–∞—Ç ‚Äî —Å –º—É—Ç–æ–º –Ω–∞ 31 —Å–µ–∫—É–Ω–¥—É
    bad_word = find_first_bad_word(text)
    if bad_word:
        chat_id = update.effective_chat.id
        user_id = update.effective_user.id

        # –û—Ç–≤–µ—Ç
        await update.message.reply_text(f'–ó–∞ "{bad_word}" –ü–æ–ª—É—á–∏—à—å –ø–æ –≥—É–±–∞–º –∏ —Ä—É–∫–∞–º! –ü–æ—Å–∏–¥–∏ –ø–æ–ª –º–∏–Ω—É—Ç—ã –ø–æ–¥—É–º–∞–π –Ω–∞ —Å–≤–æ–∏–º –ø–æ–≤–µ–¥–µ–Ω–∏–µ–º.')

        # –ú—É—Ç –Ω–∞ 31 —Å–µ–∫—É–Ω–¥—É
        try:
            until = datetime.now() + timedelta(seconds=31)
            await context.bot.restrict_chat_member(
                chat_id=chat_id,
                user_id=user_id,
                permissions={
                    "can_send_messages": False,
                    "can_send_media_messages": False,
                    "can_send_polls": False,
                    "can_send_other_messages": False,
                    "can_add_web_page_previews": False,
                    "can_change_info": False,
                    "can_invite_users": False,
                    "can_pin_messages": False,
                },
                until_date=until
            )
        except Exception:
            # –ú–æ–∂–Ω–æ –¥–æ–±–∞–≤–∏—Ç—å –ª–æ–≥–∏—Ä–æ–≤–∞–Ω–∏–µ –æ—à–∏–±–∫–∏, –Ω–æ –¥–ª—è –ø—Ä–æ—Å—Ç–æ—Ç—ã ‚Äî –º–æ–ª—á–∏–º
            pass

        return

    # 2. –°–º–∞–π–ª—ã
    if contains_funny_emoji(text):
        await reply_funny_emoji(update, context)
        return

    # 3. –ò–º–µ–Ω–∞
    words_clean = text_to_words(text)
    if '—ç–ª–∏–Ω–∞' in words_clean:
        await reply_elina(update, context)
        return
    if '—ç—Ä–∏–∫' in words_clean:
        await reply_erik(update, context)
        return

    # 4. –°–ø–∞—Å–∏–±–æ
    if contains_any(text, THANKS_WORDS):
        await reply_thanks(update, context)
        return

    # 5. –î–µ–Ω—å–≥–∏ / –î–µ–Ω–µ–≥
    text_lower = text.lower()
    if '–¥–µ–Ω—å–≥–∏' in text_lower.split() or '–¥–µ–Ω–µ–≥' in text_lower.split():
        await reply_money(update, context)
        return

    # 6. –û–∫
    if contains_any(text, OK_WORDS):
        await reply_ok(update, context)
        return

    # 7. –ï–¥–∞
    if contains_any(text, EAT_WORDS):
        await reply_eat(update, context)
        return

    # 8. –ü–µ—Ä–µ—Å—ã–ª–∫–∏ –∏ —Å—Å—ã–ª–∫–∏
    if update.message.forward_date:
        await reply_forward_or_link(update, context)
        return

    if "http://" in text or "https://" in text:
        await reply_forward_or_link(update, context)
        return

